function Nav() {
  return (
    <div className="w-full h-20 border-2 shadow-2xl ">
      <div className="flex flex-row items-center "> 
        <div className="w-1/3 bg-red-300 ">
          <h1>TradEdge</h1>
        </div>
        <div className="w-2/3 bg-blue-200 ">
          <li className=" list-none">
            <a href="">Courses</a>
            <a href="">Services</a>
            <a href="">Blog</a>
            <a href="">About us</a>
          </li>
        </div>
      </div>
    </div>
  );
}

export default Nav;
